import AXIOS from "axios"
import parameters from "./parameters";

const {baseUrl,endpoints} = parameters
const  getInstance = () =>  {
    return AXIOS.create({
      // @ts-ignore
      accept: "application/json",
      baseURL: baseUrl,
      headers: {
        Accept: "application/json",
        "Content-Type": "application/json",
      },
    });
  }




  async function getScheduleAll(params = {}) {
    const instance = getInstance();
    return await instance.get(endpoints.schedule_full,params);
  }

  async function getShows(params = {}) {
    const instance = getInstance();
    return await instance.get(endpoints.shows,params);
  }


const API_SERVICES = {
    getScheduleAll
}

export default API_SERVICES
